import BOOKING_ACTION_TYPES from './booking-types'
const INITIAL_STATE = {
    historyBook : []
}


const bookingReducer = (state = INITIAL_STATE , action) => {
    switch(action.type) {
        case BOOKING_ACTION_TYPES.GET_BOOKING_SUCCESS:
            return {
                ...state,
                historyBook : action.payload
            }
        default : 
            return state;
    }
}

export default bookingReducer;
